				$("#loader").hide();
				
		 
			 		 

			 			 
		 
		 
			if($("#modules_row").length) 
			{
				
			 $("#intro_splash").css('height',($(window).height()-$("#modules_row").height()-$("#menu").height()));
				
			 $(window).resize(function () {
				 
				$("#intro_splash").css('height',($(window).height()-$("#modules_row").height()-$("#menu").height()));
			 
			 });
			 
			 $("#read_more").click(function(){
				$("body, html").animate({ 
						scrollTop: $('#start').offset().top 
					}, 600);
				 
			 });			 
			 
			 
			}
			
		 
		 
		 
		 
		 
						 
			 $("#read_more").css("position","absolute");
			 $("#read_more").css("z-index","10000");
			 $("#read_more").css("top",$(window).height()-180);
			 $("#read_more").css("left",($(window).width()/2)-90);
			 
			 
			 var start_menu = $('#menu').offset().top;
			 
			 
			 $("#intro").css('height',$(window).height());
		 
			 $(window).resize(function () {
				$("#intro").css('height',$(window).height());
				$("#read_more").css("top",$(window).height()-180);
				$("#read_more").css("left",($(window).width()/2)-90);
			 });
				
				
				
			 $(window).scroll(function (event) {
					 
					if($(window).scrollTop() <=10 )
						$("#read_more").show();
					else
						$("#read_more").hide();
					
					
					if ($(window).scrollTop() >= start_menu) {
						$("#menu").css("position", "fixed");
						$("#menu").css("top", "0px");
						$("#menu").css("z-index", "10000");
						$("#menu").css("width", "110%");
					}
					else
					{ 
						$("#menu").css("position", "static");
						$("#menu").css("width", "auto");
					}
					
			});	 
		 
			$("#read_more").click(function(){
				$("body, html").animate({ 
						scrollTop: $('#menu').offset().top 
					}, 600);
				 
			});
			
			
			
					 
		 
		   });
        </script>


